 *from* the space where individual minds reach their limits.	LLM: Both breads are individual cognitive phenomena - capacity and decision-making ability are structurally homologous as single-brain bounded capabilities. Strong containment as collective intelligence specifically emerges in the gap between individual limits. Specificity is good with concrete cognitive constraints (working memory, processing limits) though 'collective intelligence emergence' could be more mechanistically precise. | Specificity: 0.700 | Nontrivial: sim(filling,top)=0.360, sim(filling,bottom)=0.298 | Novelty: max_corpus_sim=0.300	A satisfying construction. Both breads are individual-mind limitations—the structural parallel is clean. The filling sits exactly where it must: in the space between what one brain can hold and what one brain can choose. Sometimes the most elegant sandwiches are about watching emergence fill the gaps in our architecture.	0.7
