ssment and rigorous positional mathematics, often simultaneously. The filling is bounded because it must satisfy both the artist's imperative to avoid immediate hazards and the scientist's imperative to maintain accurate course and position.	LLM: Both breads are approaches to navigation that exist in natural tension independent of any specific practice - art vs science is a classic epistemological divide. The filling is genuinely constrained by needing to satisfy both intuitive hazard avoidance and mathematical precision simultaneously. All ingredients are domain-specific (celestial mechanics, seamanship, chart work) rather than vague abstractions. | Specificity: 0.800 | Nontrivial: sim(filling,top)=0.555, sim(filling,bottom)=0.616 | Novelty: max_corpus_sim=0.282	A satisfying construction. The bread pairing writes itself—art and science have been philosophical dance partners since Aristotle. What pleases me here is how marine navigation refuses to choose sides. The navigator reading swells by moonlight while calculating celestial fixes embodies both modes completely. No compromise, just synthesis.	0.8
