em can transition from the heated state to achieve sub-baseline cooling—without this radiative loss, field removal would simply return the material to its original temperature rather than below it.	LLM: Both breads are thermodynamic states of the same material system - heating and cooling phases that form natural temporal boundaries in magnetocaloric cycles, independent of the filling mechanism. The heat radiation period is perfectly contained as the only process that enables transition from heated to sub-baseline states. All ingredients are domain-specific: magnetic field application, magnetocaloric effect, and radiative heat transfer are precise thermodynamic phenomena. | Specificity: 1.000 | Nontrivial: sim(filling,top)=0.648, sim(filling,bottom)=0.562 | Novelty: max_corpus_sim=0.402	A satisfying temporal sandwich. The heating and cooling phases were clearly meant to be together—opposite magnetic states of the same material. What makes it work is finding that specific moment of heat dissipation tucked between them. Without that radiative pause, you'd have mere warming and return-to-baseline. With it, you get actual refrigeration.	1
