ization is perfectly contained within this space because it describes the orientational degrees of freedom that exist only when perpendicular oscillation is possible, making it a property that emerges from and is bounded by this geometric distinction.	LLM: Both breads are wave types in physics, related independently as the fundamental geometric dichotomy of oscillation direction relative to propagation. Polarization is perfectly contained - it can only exist when oscillations are perpendicular to propagation (transverse) and is definitionally impossible when parallel (longitudinal). All ingredients are specific physics concepts with precise technical definitions. | Specificity: 1.000 | Nontrivial: sim(filling,top)=0.245, sim(filling,bottom)=0.236 | Novelty: max_corpus_sim=0.427	A satisfying construction. The wave geometries form a natural complementary pair—perpendicular versus parallel—and polarization sits precisely in that geometric gap where orientation becomes a degree of freedom. Clean boundaries, no waste.	1
